import React, { useState, useEffect } from 'react';
import { Form, Input, Button, Select, Row, Col } from 'antd';
import axios from 'axios';

const { Option } = Select;

const Home = ({ onFilter }) => {
  const [cities, setCities] = useState([]);
  const [districts, setDistricts] = useState([]);
  const [selectedCityId, setSelectedCityId] = useState(null);
  const [loadingDistricts, setLoadingDistricts] = useState(false);

  useEffect(() => {
    const fetchCities = async () => {
      try {
        const response = await axios.get(
          'https://v1.nocodeapi.com/ebr123/google_sheets/MBXXeYjRrYchwfWk?tabId=ıller&filterValue=SEHİRLER'
        );
        setCities(response.data.data);
      } catch (error) {
        console.error('İller alınırken hata oluştu:', error);
      }
    };
    fetchCities();
  }, []);

  useEffect(() => {
    const fetchDistricts = async () => {
      if (!selectedCityId) return;
      setLoadingDistricts(true);
      try {
        const response = await axios.get(
          `https://v1.nocodeapi.com/ebr123/google_sheets/MBXXeYjRrYchwfWk?tabId=ılceler&filterValue=ılceler`
        );
        const filteredDistricts = response.data.data.filter(item => item.id === selectedCityId);
        setDistricts(filteredDistricts.map(item => item.ılceler));
      } catch (error) {
        console.error('İlçeler alınırken hata oluştu:', error);
      } finally {
        setLoadingDistricts(false);
      }
    };
    fetchDistricts();
  }, [selectedCityId]);

  const handleFilter = (values) => {
    axios.post('/api/filter-properties', values)
      .then(response => {
        onFilter(response.data);
      })
      .catch(error => {
        console.error('Filtreleme yapılırken hata oluştu:', error);
      });
  };

  return (
    <div style={{ 
      backgroundImage: 'url(https://izcelikyapi.com/wp-content/uploads/2022/05/iki-katli-celik-ev-modelleri.webp)', 
      backgroundSize: 'cover', 
      backgroundPosition: 'center', 
      height: '100vh', 
      display: 'flex', 
      justifyContent: 'center', 
      alignItems: 'center',
      color: 'white',
      position: 'relative'
    }}>
      <div style={{ textAlign: 'center' }}>
        <h1 style={{ fontSize: '48px', fontWeight: 'bold' }}>Find Your New Home!</h1>
        <Form layout="inline" onFinish={handleFilter} style={{ background: 'rgba(0, 0, 0, 0.5)', padding: '20px', borderRadius: '10px' }}>
          <Form.Item name="name">
            <Input placeholder="İlan Başlığı" />
          </Form.Item>
          <Form.Item name="minPrice">
            <Input placeholder="Min Fiyat" type="number" />
          </Form.Item>
          <Form.Item name="maxPrice">
            <Input placeholder="Max Fiyat" type="number" />
          </Form.Item>
          <Form.Item name="city">
